                type="text"
                value={restaurant}
                onChange={handleInputChange}
            />

            <TextField className='textField'
                required
                id="outlined-required"
                label="password"
                name="password" 
                type="password"
                value={password}
                onChange={handleInputChange}
            />

            <TextField className='textField'
                required
                id="outlined-required"
                label="email"
                name="email"
                type="email"
                value={email}
                onChange={handleInputChange}
            />

